css:
:root {
  font-size: 16px;
}
.bottom-dock .toolbar {
  flex: none;
  display: block;
  font-size: 11px;
  line-height: -2px;
  height: 4px;
  position: relative;
  -webkit-user-select: none;
  cursor: default;
  overflow: hidden;
  white-space: nowrap;
  min-width: -webkit-min-content;
  background-color: #002b36;
  border-bottom: rgba(0, 0, 0, 0.1) 1px solid;
}
.bottom-dock .toolbar a,
.bottom-dock .toolbar a:hover {
  color: rgba(131, 148, 150, 0.8);
}
.bottom-dock .toolbar .flexbox {
  padding: 0 0.5;
  display: flex;
  justify-content: space-between;
}
.bottom-dock .toolbar .toolbar-left {
  padding-left: 0.5rem;
  flex: 1 1 33%;
}
.bottom-dock .toolbar .toolbar-right {
  float: right;
  padding-right: 0.5rem;
}
.bottom-dock .toolbar .toolbar-right .inline-block {
  margin-right: 0;
  margin-left: 0.5rem;
}
.bottom-dock .toolbar .toolbar-right .inline-block > .inline-block {
  margin-left: 0;
}
.bottom-dock .toolbar .toolbar-left,
.bottom-dock .toolbar .toolbar-right {
  overflow-x: auto;
}
.bottom-dock .toolbar .toolbar-left::-webkit-scrollbar,
.bottom-dock .toolbar .toolbar-right::-webkit-scrollbar {
  display: none;
}
.bottom-dock .toolbar .inline-block {
  max-width: 20vw;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.bottom-dock .toolbar .icon:before {
  font-size: 14px;
  width: 14px;
  height: 14px;
  position: relative;
  top: 1px;
  margin-right: 0px;
}
